import React from 'react';
import c from './Header.module.css';


const Header = () => {
    return <header className={c.header}>
        <img src='https://miro.medium.com/max/1200/1*NdunrmlxgPAsm8_7NLdTdg.png' />
    </header>
}

export default Header;
